import { Route, Routes } from 'react-router-dom';
import Test from './page/Test';

function App() {
    return (
        <div className="App">
            <Routes>
                {/* <Route path='/' element={<FrontBoard />}></Route> */}
                <Route path='/test' element={<Test />}></Route>
            </Routes>
        </div>
    );
}

export default App;
